import React from 'react';
import './SearchResultsPage.css';

const SearchResultsPage = () => {

    const searchTerm = "Laptop";
    const totalResults = 100;
    const displayedResults = 10;

    const productPhoto = "/Computer.jpg";
    const productName = "MacBook Pro Laptop";
    const storeCount = 5;
    const individualPrice = 3500;

    const productPhoto1 = "/Maple.png";
    const productName1 = "Maple Syrup";
    const storeCount1 = 12;
    const individualPrice1 = 7;

    return (
      <div className="tableWrapper">
        <div className="tableContainer">
            <div className="tableHeaderInfo">
                Showing results for: <strong>{searchTerm}</strong>
            </div>
            <div className="tableHeaderInfo">
                Total results: {totalResults}
            </div>
            <div className="tableHeaderInfo">
                Displaying: {displayedResults}
            </div>
        </div>
        <div className="buttonsContainer">
            <button>
                <img src="icons/SortIcon.png" alt="Sort" width="20" />
                Sort by
            </button>
            <button>
                <img src="icons/FilterIcon.png" alt="Filter" width="20" />
                Filters
            </button>
        </div>
        <table>
            <thead>
                <tr>
                    <th>Product Photo</th>
                    <th>Product Name</th>
                    <th>Store Count</th>
                    <th>Individual Price ($)</th>
                    <th>Add To Cart</th>
                </tr>
            </thead>
            <tbody>
                <tr>
                    <td><img src={productPhoto} alt="product" width="200" /></td>
                    <td>{productName}</td>
                    <td>{storeCount}</td>
                    <td>{individualPrice}</td>
                    <td><button>Add To Cart</button></td>
                </tr>
                <tr>
                    <td><img src={productPhoto1} alt="product" width="200" /></td>
                    <td>{productName1}</td>
                    <td>{storeCount1}</td>
                    <td>{individualPrice1}</td>
                    <td><button>Add To Cart</button></td>
                </tr>
            </tbody>
        </table>
      </div>
    );
}

export default SearchResultsPage;
